A fierce gust of wind shook you out of your daydream.\n\nMonica was not here. You never got back together, and the years had not passed. You were still on the podium, waiting to be sworn in.\n\nChief Justice Garaci stood next to you and said, "Please repeat after me. I do solemnly swear that I will respectfully execute the Office of the President of Sordland..."



